  getPrice = () => {

    this.setState({
      spinners: true
    }, () => {

      console.log(this.state.trackcode)

      fetch('https://expressalllogistics.com/logistics/findrider.php', {
        method: 'POST',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({


          pname: pfullname,
          paddress: paddress,
          pphone: this.state.ppphone,
          citi: pcity,
          dname: rfullname,
          dadd: raddress,
          dphone: rphone,
          pricing: this.state.price,
          ridetype: ride,
          itemns: itemName,
          weight: weight,
          description: pdescription,
          quantity: quantity,
          items: Items,
          mobile: mobile,
          dstates: dstatename,
          dcitie: rcity,
          pstates: pickupstate,
          plat: plats,
          plong: plongs,
          dlat: dlats,
          dlong: dlongs,
          trackcode: this.state.trackcode,
          distanc: this.state.distances,
          duratio: this.state.durations

        })


      }).then((response) => response.json())
        .then((responseJson) => {

          this.setState({
            spinners: false
          }, () => {

            var code = responseJson.Tripcode;

            if (code == 1) {
              // alert(price)

              this.props.navigation.navigate("findrider", { value: 1, trackcode: this.state.trackcode })


              //this.timer = setInterval(() => this.getMovies(), 10000)

            }
            else if (code == 3) {
              alert("Request already sent")


