      ppfullname: pfullname,
      ppaddress: paddress,
      ppphone: pphone,
      ddfullname: rfullname,
      ddaddress: raddress,
      dddphone: rphone,
      price: prices,
      rides: ride,
      itemNames: itemName,
      weights: weight,
      descriptions: pdescription,
      quantities: quantity,
